import './Home.css'

import * as React from "react";

import { Header } from "./Header/Header"
import { Body } from "./Body/Body"
import { Footer } from "./Footer/Footer"

export class Home extends React.Component {
    render() {
        return (
            <div className="root">
                <Header language="EN"/>
                <Body language="EN"/>
                <Footer language="EN"/>
            </div>
        )
    };
}
